    flex-direction: column;
    border: solid lightgray 1px;
    margin: 1rem auto;
    width: 80%;
    @media (max-width: 768px) {
}  
`;

  const Title = styled.h1`
    margin: 1rem;
    text-align: center;
  `;
  return (
    <>
      <Container>
        <Title>Photo album - Friends, Festivals, Dregs, Ballers</Title>
        <PhotoAlbum />
      </Container>
    </>
  );
}

export default App;
